// You can think of these components as "pages"
// in your app.

function Home() {
  return (
    <div>
      <h2>Home Page is Loaded</h2>
    </div>
  );
}

function About() {

  return (
    <div>
      <h2>About</h2>
    </div>
  );
}

function Dashboard() {
  return (
    <div>
      <h2>Dashboard</h2>
    </div>
  );
}

function User() {
  let { name } = useParams();
  return (
    <div>
      <h2>Current player : {name}</h2>
	  <table>
		<thead><tr><td>Name</td><td>Id</td></tr></thead>
		<tbody>
			<tr><td><Link to="/user/player1">player1</Link></td><td>1</td></tr>
			<tr><td><Link to="/user/player2">player2</Link></td><td>2</td></tr>
		</tbody>
	</table>
    </div>
  );
}
